import React from 'react';
import { Card, Icon, Image, Item, Segment } from 'semantic-ui-react';
import { format } from 'date-fns';
import local from 'date-fns/locale/fr';
import { IAffilie } from '../../../app/models/affilie';







const MisesAjours: React.FC<{ affilie: IAffilie }> = ({ affilie }) => {

    return (


        <div>

            {affilie.misAjours.map(Maj => Maj.rejetMajs.length > 0 ?

                Maj.rejetMajs.map(rej => rej.corrigeRejets.length > 0 ?
                    (rej.corrigeRejets.map(corri =>
                        <>
                            <Segment vertical>
                                {format(Maj.dateMaj, 'd MMMM yyyy', { locale: local })}
                                {Maj.typeMaj}
                                {Maj.info} {Maj.infoIdentifiant}
                                {format(rej.dateRejet, 'd MMMM yyyy', { locale: local })}
                                {rej.motif}
                                {format(corri.dateCorrige, 'd MMMM yyyy', { locale: local })}
                            </Segment>

                        </>

                    )
                    ) :

                    <>

                        <Segment  color='red' vertical>

                        <Item>
                        <Item.Image size='small' src='/images/wireframe/image.png' />

                        <Item.Content>
                            <Item.Header as='a'>Cute Dog</Item.Header>
                            <Item.Description>{format(Maj.dateMaj, 'd MMMM yyyy', { locale: local })}</Item.Description>
                            <Item.Extra>
                            <Icon color='green' name='check' /> {Maj.typeMaj}
                            </Item.Extra>
                        </Item.Content>
                        </Item>

                            {Maj.typeMaj}
                            {Maj.info} {Maj.infoIdentifiant}
                            {format(rej.dateRejet, 'd MMMM yyyy', { locale: local })}
                            {rej.motif}
                        </Segment>


                    </>
                ) :
                <>
                    <Segment vertical>
                        {format(Maj.dateMaj, 'd MMMM yyyy', { locale: local })}
                        {Maj.typeMaj}
                        {Maj.info} {Maj.infoIdentifiant}
                    </Segment>
                </>

            )
            }






        </div>


    );


}

export default MisesAjours



